import React from 'react';
import './TweetBox.css';
import { Avatar, Button } from '@material-ui/core';

function TweetBox() {
    return (
        <div className='tweetBox'>
            <form>
            <div className='tweetBox__input'>
            <Avatar  src='https://cdn.arstechnica.net/wp-content/uploads/2021/09/GettyImages-1315228697-800x533.jpg'/>
            <input placeholder="What's up?" type="text" />
            </div>
            <input
            className='tweetBox__imageInput' placeholder='Enter image URL' type="text" />
            <Button className='tweetBox__tweetButton'>Tweet</Button>
            </form>
        </div>
    )
}

export default TweetBox
